import React from 'react';

function Modal ({closeModal}: any) {
    return (
        <div>
        <div className="container">
            <div className="content">
                Um, it's empty...
            </div>
            <div>
                <button onClick={() => {
                    closeModal(false);
                    }}
                    >Close</button>
            </div>
        </div>
        </div>
    );
}

export default Modal;
